        display: 'About'
    },
    {
        path:'/tours',
        display: 'Tours'
    },
]

const Header = () => {
    return <header className='header'>
        <Container>
            <Row>
                <div className="nav__wrapper d-flex align-items-center justify-content-between">

                    {/* ======== Logo ======= */}
                    {/* ======== Logo End ======= */}

                </div>
            </Row>
        </Container>
    </header>
}

export default Header;
